@import url("https://fonts.googleapis.com/css2?family=Flamenco&family=Gideon+Roman&family=Roboto+Condensed&display=swap");
:root {
  --1st-color: #fdb321;
  --2st-color: #d980fa;
  --3st-color: #42a5f5;
  --4st-color: #fff;
  --5st-color: #000;
  --third-font: "Roboto Condensed", sans-serif;
  --four-font: "Gideon Roman", cursive;
  --six-font: "Flamenco", cursive;
}
html {
  -webkit-scroll-behavior: smooth;
  scroll-behavior: smooth;
}
* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  font-family: var(--third-font);
  font-weight: 800;
  /* color: #edf1ec; */
}
.container {
  width: 100%;
  min-height: 100vh;
  overflow: hidden;
  position: relative;
}
#wrapper_container {
  width: 100%;
  height: 100%;
}

/* **** NAV tag start ***********  */
 nav{
  margin: 0 auto;
  width: 100%;
  line-height: 3rem;
  height: 12vh;
  background-color: #49a870c2;
  position: fixed;
  top: 0;
  z-index: 111111;
}
 nav .nav_child {
   margin: 0 auto;
  width: 90%;
  display: flex;
  justify-content: space-between;
  align-items: center;
}
 nav .nav_child .header {
  display: flex;
  align-items: center;
}
.header header span {
  font-size: 3.5rem;
  color: var(--3st-color);
  font-family: var(--four-font);
}
.header header {
  text-transform: uppercase;
  font-size: 2rem;
  margin-right: 1.5rem;
  color: var(--1st-color);
  font-family: var(--four-font);

}
.header header::after {
  content: "";
  display: block;
  border: 2px solid var(--1st-color);
}

/* style toggle mode switch   */
#light {
  width: 4.5rem;
  height: 2rem;
  cursor: pointer;
  display: flex;
  align-items: center;
  background-color: #fff;
  margin-top: 1rem;
  border-radius: 20px;
  border: 2px solid var(--1st-color);
  box-shadow: 0px 0px 8px 0px var(--1st-color);
}
#dark {
  width: 1.4rem;
  height: 1.4rem;
  border-radius: 50%;
  transition: 0.4s;
  margin: 1px;
  background-color: var(--1st-color);
  box-shadow: -1px -1px 22px 0px var(--1st-color);
}
#dark.active {
  margin-left: 2.5rem;
}
.backcolor {
  background-color: rgb(53, 54, 54); /* background-color for whole screen */
}
.backcolor > #section ul li a {
  color: #fff;
}
.backcolor > #section .Header_section h1 {
  color: var(--4st-color);
}
.backcolor > #section .Header_section p {
  color: var(--4st-color);
}
/* ********** style Nav Class ***************** */
#check {
  display: none;
}
.btncheck {
  visibility: hidden;
}
nav .nav {
  display: flex;
  align-items: center;
}
.nav header {
  display: none;
}
.nav ul {
  margin: auto;
  height: 100%;
  line-height: 2.5em;
  list-style: none;
  display: flex;
  justify-content: start;
  align-items: center;
}
nav .nav ul li {
  width: 100%;
  text-align: center;
}
nav .nav ul li a {
  padding: 0 1em;
  width: 100%;
  box-sizing: border-box;
  text-decoration: none;
  text-transform: capitalize;
  transition: 0.3s;
  border-radius: 0.2em;
  display: block;
  color: var(--5st-color);
}
ul li a:after {
  content: "";
  display: block;
  height: 0.2em;
  width: 0%;
  background-color: var(--1st-color);
  transition: 0.3s;
}
ul li a:hover:after {
  width: 100%;
  font-size: 1.05em;
}
nav .nav ul li:last-child {
  width: 16vw;
  height: 50%;
  line-height: 1rem;
  border-radius: 0.5rem;
  padding: 0rem 1rem;
  border-radius: 1rem;
  border: none;
  font-size: 1rem;
  text-transform: capitalize;
  background-color: var(--1st-color);
}
     nav .nav ul li i{
      display: none;
    }
nav .nav ul li:last-child a {
  color: var(--4st-color);
}
/* Start styling section  and Header_section  */
#section{
  width: 100%;
  min-height: 100vh;
  position: relative;
}
.Header_section{
  margin: 0 auto;
  width: 90%;
  display: flex;
}
.Header_section #header_1{
  width: 50%;
  min-height: 100vh;
  display:flex;
  align-items: center;
  text-transform: capitalize;
}

#header_1 .title .typewitting {
  color: var(--1st-color);
}
#header_1 .title .printer {
  color: var(--3st-color);
}
#header_1 .title h1 {
  font-size: 2.5rem;
  color: var(--5st-color);
}
#header_1 .title p {
  margin: 0 auto;
  width:80%;
  padding: 1rem 0;
  color: var(--5st-color);
} 
#header_1 .title button {
  margin-top: 1rem;
  padding: 0.5rem 3rem;
  border-radius: 1rem;
  border: 1px solid #fff;
  font-size: 1rem;
  color: var(--4st-color);
  cursor: pointer;
  background-color: var(--1st-color);
}
#header_1 button:hover {
  box-shadow: -1px -1px 22px 0px var(--1st-color),
    inset 0px -15px 22px 0px var(--1st-color);
}
.Header_section #header_2{
  width: 50%;
  min-height: 100vh;
  position: relative;
}
#header_2 .img{
  width: 100%;
  height: 100%;
  display:flex;
  justify-content: center;
}
#header_2 .img .charecter {
  width: 26em;
  height: 26em;
  position: absolute;
  background-color: var(--1st-color);
  border-radius: 200px 25px 200px 25px;
  box-shadow: 0px 0px 91px 11px rgb(248, 169, 22);
  animation: down_up 2s linear infinite;
}
@keyframes down_up {
  0% {
    transform: translateY(0);
  }
  40% {
    transform: translateY(40px);
  }
  80% {
    transform: translateY(-40px);
  }
} 
.header2_img {
  position: absolute;
  width: 27em;
  height: 27em;
  background-image: url("../image/28.png");
  background-size: cover;
  background-position: 100% 100%;
}

/* ********  starting  Section_Education *************** */
#section_edu {
  width: 100%;
  position: relative;
  padding-top: 2rem;
}
.under_edu {
  position: relative;
  margin: 0 auto;
  width: 80%;
  min-height: 100vh;
  display:flex;
  justify-content: start;
  align-items: start;

}
.backcolor > #section_edu {
  color: #fff;
}
.title_edu {
  width: 45%;
  height: 100%;
  padding-top: 4vw;
}
.title_edu h1 {
  text-transform: capitalize;
  margin-bottom: 4rem;
}
.title_edu h1::after{
  content: "";
  width: 40%;
  height: 0.3rem;
  display: block;
  background-color: var(--1st-color);
}
.title_edu h1:nth-child(2) {
  color: #fdb321;
  padding: 0 0 0.6rem 0;
  
}
.card_edu{
  width: 55%;
  height: 100%;
}
.card_edu .matric,
.card_edu .inter,
.card_edu .btech{
  width: 240px;
  height: 260px;
  display: grid;
  place-items: center;
  position: absolute;
}
.matric .card_box,
.inter .card_box,
.btech .card_box{
   width: 200px;
  height: 240px;
  position: absolute;
  transform: perspective(1000px);
  border: 0.4rem solid var(--1st-color);
  transition: all 0.4s;
}
.matric .card_box{
  transform: rotateY(15deg) translateX(22px) translateY(-20px)
}
.inter .card_box{
  transform: rotateY(-15deg) translateX(-22px) translateY(-20px);
}
.btech .card_box{
  transform: rotateY(15deg) translateX(22px) translateY(-20px)
}
.offer-item{
  width: 200px;
  height: 240px;
  position: absolute;
  background-color: #fff;
  transform: perspective(1000px);
  cursor: pointer;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  border: 0.4rem solid var(--5st-color);
  box-shadow: 0 0 8px 0 rgba(35, 35, 35, 0.2);
  z-index: 11;
  transition: all 0.3s ease-in-out;
}
.matric .offer-item:hover ~ .card_box{
  border: 0.4rem solid var(--3st-color);
  transform: scale(1.05) translateX(25px) translateY(-25px);
}
.inter .offer-item:hover ~ .card_box{
  border: 0.4rem solid var(--3st-color);
 transform: scale(1.05) translateX(-25px) translateY(-25px);
}
.btech .offer-item:hover ~ .card_box{
  border: 0.4rem solid var(--3st-color);
   transform: scale(1.05) translateX(25px) translateY(-25px);

}
.card_edu .matric {
  top: 3vw;
  right: 0vw;
}
.card_edu .inter {
  top: 13vw;
  right: 20vw;
}
.card_edu .btech {
  bottom: 0vw;
  right: 0vw;
}
.offer-content {
  text-align: center;
}
.offer-item img {
  max-width: 100px;
  margin: 0 auto;
}
.content {
  height: 0px;
  overflow-y: scroll;
  transition: height 0.3s ease-in-out;
  margin-bottom: 1rem;
}
.content p {
  font-size: 0.95rem;
  line-height: 1.6rem;
  opacity: 0.9;
  margin: 0.4rem;
}
.content::-webkit-scrollbar {
  width: 0;
}
.content-show {
  height: 300px;
}
.name {
  font-weight: 700;
  font-size: 1.4rem;
}
.collapsible-icon {
  display: block;
  margin-top: 0.5rem;
  cursor: pointer;
  font-size: 1.2rem;
  transition: color 0.2s ease-in-out;
}
.collapsible-icon:hover {
  color: #bc1823;
}

/* ********  Ending  Section_Education *************** */
/* ********  starting  section_skill *************** */
#section_skill {
  width: 100%;
  min-height: 100vh;
}
.child_skill {
  margin: 1rem auto;
  width: 80%;
  min-height: 100%;
  padding-top: 3rem;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
}
.backcolor > #section_skill {
  color: #fff;
}
.Third_header1 {
  width: 100%;
  max-height: 15vh;
  font-size: 1.5rem;
  text-align: center;
  text-transform: capitalize;
  display: grid;
  place-items: center;
}
.Third_header1 h2{
  display: grid;
  place-items: center;
}
.Third_header1 h2::after{
  content: "";
  width: 140%;
  height: 0.3rem;
  display: block;
  text-align: center;
  background-color: var(--1st-color);
}
.Third_header2 {
  margin: 0 auto;
  width:80%;
  max-height: 25vh;
  text-align: justify;
  text-transform:lowercase;
  font-size: 1rem;
  margin: 2rem 0;
  font-family: "Times New Roman", Times, serif;
}
.content-up {
  width: 90%;
  min-height: 60vh;
  display: flex;
  justify-content: space-between;
  align-items: center;
  flex-wrap: wrap;
}
.animte {
  width: 8rem;
  height: 8rem;
  margin: 1.5rem;
  position: relative;
  display: grid;
  place-items: center;
  transition: all 0.3s;
}
/* .animte:hover {
  transform: rotateY(15deg) translateX(-15px) translateY(-15px);
} */
.start .animte .pen {
  width: 8.5rem;
  height: 8.5rem;
  border-radius: 50%;
  display: grid;
  place-items: center;
  background-color: #f1f5ef;
  position: relative;
  transform: rotate(calc(3.6deg * var(--num)));
  animation: dot 1.3s linear forwards;
}
@keyframes dot {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(calc(3.6deg * var(--num)));
    background-color: var(--1st-color);
    box-shadow: 1px -1px 15px 0px var(--1st-color);
  }
}
.counter {
  width: 8.5rem;
  height: 8.5rem;
  border-radius: 50%;
  border: 4px solid var(--1st-color);
  text-transform: uppercase;
  background-color: #fff;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
}
.backcolor > #section_skill .counter {
  background-color: var(--5st-color);
}
.pen::before {
  content: "";
  position: absolute;
  z-index: 10;
  background-color: var(--3st-color);
  box-shadow: 1px -1px 38px 12px var(--3st-color);
  width: 10px;
  height: 10px;
  transform: rotate(calc(3.6deg * var(--num)));
  border-radius: 50%;
  left: -4px;
}
.start .box {
  width: 10.7rem;
  height: 10.7rem;
  border-radius: 50%;
  text-transform: uppercase;
  position: absolute;
    cursor: pointer;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  opacity: 0;
  animation: fadeIn 1s linear forwards;
  animation-delay: 2s;
}
@keyframes fadeIn {
  0% {
